import React from "react";
import './nav.css';

function Nav () {
    return (
        <nav>
            <ul>
                <li data-tooltip="Home"><a href="#"  className = "home-fa"><i className="fa-solid fa-house"></i></a></li>
                <li data-tooltip="About"><a href="#"  className = "about-fa"><i className="fa-solid fa-user"></i></a></li>
                <li data-tooltip="Skills"><a href="#"  className = "skills-fa"><i className="fa-solid fa-code"></i></a></li>
                <li data-tooltip="Projects"><a href="#"  className = "projects-fa"><i className="fa-solid fa-folder"></i></a></li>
                <li data-tooltip="Contact"><a href="#"  className = "contact-fa"><i className="fa-solid fa-phone"></i>xx</a></li>
            </ul>
        </nav>
    );
}

export default Nav;
